libs.content:
find_library(_lib
            names lib${l}.a ${l}
            paths ${${_service}_root}
            hints ${${_service}_root}/lib64 ${${_service}_root}/lib
            path_suffixes ${${_mytype}_${_myservice}_library_path_suffixes}
            no_default_path
            )

find_library(_lib
                     names ${_l}
                     hints ${_fullspec}
                           ${openmp_library_dirs}
                     doc "path to the ${_l} library for openmp"
                     no_default_path)
